import React from 'react';
import './App.css';

class CompletedCourse extends React.Component {
  render() {
    return (
      <React.Fragment>
        <p>
          <strong>{this.props.data.number}:</strong> {this.props.data.name}
        </p>
      </React.Fragment>
    )
  }
}

export default CompletedCourse;
